INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001, 401, 102301, 2, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "アヤネ", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002, 402, 102301, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "アヤネ", 10046, 24, 2.21);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003, 403, 102301, 2, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "アヤネ", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004, 701, 192201, 1, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "アサヒ", 10046, 24, 1.99);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005, 702, 192201, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "アサヒ", 10046, 24, 2.21);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006, 703, 192201, 1, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "アサヒ", 10046, 24, 3.33);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007, 801, 192301, 2, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "部員３", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008, 802, 192301, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "部員３", 10046, 24, 2.68);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009, 803, 192301, 2, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "部員３", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("やった！", 24010, 501, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("勝ったよ！", 24011, 502, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("いい調子！", 24012, 503, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013, 111, 113501, 2, 0.0, "2030/12/17 14:59:59", 0.0, 6, "2020/07/31 12:00:00", "ミサト", 10046, 24, 5.33);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014, 112, 113501, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "ミサト", 10046, 24, 6.85);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015, 113, 113501, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "ミサト", 10046, 24, 3.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016, 611, 192401, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "ダイチ", 10046, 24, 6.11);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017, 612, 192401, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "ダイチ", 10046, 24, 6.75);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018, 613, 192401, 2, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "ダイチ", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019, 211, 113401, 1, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "ハツネ", 10046, 24, 4.52);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020, 212, 113401, 1, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "ハツネ", 10046, 24, 3.89);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021, 213, 113401, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "ハツネ", 10046, 24, 13.49);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022, 311, 106501, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "カヤ", 10046, 24, 3.17);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023, 312, 106501, 2, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "カヤ", 10046, 24, 4.42);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024, 313, 106501, 1, 0.0, "2030/12/17 14:59:59", 0.0, 6, "2020/07/31 12:00:00", "カヤ", 10046, 24, 2.89);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025, 421, 102301, 3, 0.0, "2030/12/17 14:59:59", 0.0, 4, "2020/07/31 12:00:00", "アヤネ", 10046, 24, 3.71);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026, 721, 192201, 1, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", "アサヒ", 10046, 24, 5.1);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027, 821, 192301, 3, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "部員３", 10046, 24, 4.34);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("いい勝負だったよ\nまたやろうね", 24028, 521, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", "", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029, 101, 113501, 2, 0.0, "2030/12/17 14:59:59", -360.0, 1, "2020/07/31 12:00:00", "ミサト", 10046, 24, 5.62);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030, 102, 113501, 2, 0.0, "2030/12/17 14:59:59", -360.0, 1, "2020/07/31 12:00:00", "ミサト", 10046, 24, 9.58);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031, 103, 113501, 2, 0.0, "2030/12/17 14:59:59", -360.0, 2, "2020/07/31 12:00:00", "ミサト", 10046, 24, 0.0);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032, 104, 113501, 1, 0.0, "2030/12/17 14:59:59", -360.0, 2, "2020/07/31 12:00:00", "ミサト", 10046, 24, 9.13);
INSERT INTO `v1_b54b0124696648883dca4d515c0caf5a83fedbac4de1e9cd537f4c6b4ed6deed` VALUES ("絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033, 105, 113501, 2, 0.0, "2030/12/17 14:59:59", -360.0, 1, "2020/07/31 12:00:00", "ミサト", 10046, 24, 8.27);
